import styled from "styled-components";

export const MinusSign = styled.img`
  position: absolute;
  width: 20px;
  height: 15px;
  right: 358px;
  top: 365px;

  display: flex;

  color: #000000;
`;
export const PlusSign = styled.img`
  width: 850px;
  height: 800px;
`;
